import "./CoinField.css";
import Aux from "../../../hoc/Aux";
const coinField = (props) => {
  return (
    <Aux>
      <div>{props.title}</div>
      <div>
        <input placeholder="1.0" type="number"></input>
        <span>{props.coinName}</span>
      </div>
    </Aux>
  );
};
export default coinField;
